INSERT INTO `sensor_words` (`id`, `sensor_label_id`, `words`, `priority`, `sensory_sensors_id`, `topic_type`, `status`, `description`, `reg_date`) VALUES
(187, 1, 'انرژیم بالا می‌ره / سرحال میام / با نشاط می‌شم / خستگی‌ام برطرف می‌شه', 1, 8, 1, 1, NULL, '2019-11-01 18:39:36'),
(188, 2, 'لذت بدنی می‌برم / کیف می‌کنم / بدنم ارضا می‌شه / مشتاق می‌شم /‌‌ پر از خواهش می‌شم', 2, 8, 1, 1, NULL, '2019-11-01 18:40:18'),
(189, 3, 'بـو ‌های خوبی تجربه می‌کنم / طعم‌های خوبی تجربه می‌کنم /  صدای گوش‌نوازی تجربه می‌کنم / بدنم نوازش می‌شه', 3, 8, 1, 1, NULL, '2019-11-01 18:40:53'),
(190, 4, 'انژریم پایین میاد / بی حال می‌شم / کسل می‌شم / خسته می‌شم', 1, 10, 1, 1, NULL, '2019-11-01 18:42:44'),
(191, 5, 'بدنم درد می‌گیره / رنج می‌کشم / بدنم ارضا نمی‌شه / سرد می‌شم / پر از انزجار می‌شم', 2, 10, 1, 1, NULL, '2019-11-01 18:43:25'),
(192, 6, 'بـو های بدی تجربه می‌کنم / طعم‌های بدی تجربه می‌کنم / صدای گوش آزار تجربه می‌کنم / کتک می‌خورم', 3, 10, 1, 1, NULL, '2019-11-01 18:43:58'),
(193, 7, 'حق انتخابم بیشتر می‌شه / می تونم تاثیرگـذار باشم / قدرت تصمیم‌گیریم بیشتر می‌شه / امکان تصمیم‌گیری دارم / می‌تونم وضعیت رو تغییر بدم / آزادی عمل دارم / روش کنترل پیدا می‌کنم / خلاق‌تـر می‌شم / کنترلش دست منه', 1, 7, 1, 1, NULL, '2019-11-01 18:47:28'),
(194, 8, 'قوی‌تـر می‌شم / احساس قدرت می‌کنم / تسلط پیدا می‌کنم / اعتماد بنفس پیدا می‌کنم / مستقل می‌شم / روی پای خودم می‌ایستم / آقـابالاسـر ندارم', 2, 7, 1, 1, NULL, '2019-11-01 18:47:28'),
(195, 9, 'آزادیم بیشتر می‌شه / فضای بیشتری پیدا می کنم / احساس آزادی و رهایی می‌کنم / انتخاب کردم / اختیارم دست خودمه / فضای شخصی بهم می‌ده / حریم خصوصیم رعایت می‌شه / ماجراجو می‌شم / کنترل نمی‌شم', 3, 7, 1, 1, NULL, '2019-11-01 18:47:28'),
(196, 10, 'حق انتخابم کمتر می‌شه / اثرگذاریم کم می‌شه / قدرت تصمیم‌گیریم کمتر می‌شه / امکان تصمیم‌گیری ندارم / نمی تونم اوضاع رو تغییر بدم / آزادی عمل ندارم / روش کنترلم از دست می‌دم / فاقد خلاقیت می‌شم / کنترلش دستم نیست', 1, 9, 1, 1, NULL, '2019-11-01 18:51:51'),
(197, 11, 'ضعیف‌تر می‌شم / احساس ضعف می‌کنم / روم تسلط پیدا می‌کنم / اعتماد بنفس از دست می‌کنم / استقلالم رو از دست می‌دم / وابسته دیگران میشم / ارباب دارم', 2, 9, 1, 1, NULL, '2019-11-01 18:52:15'),
(198, 12, 'اسیر میشم / محدود می‌شم / احساس اسارت و گیر افتادن دارم / انتخاب نکردم / اختیارم دست خودم نیست / فضای شخصیم رو می‌گیره / حریم خصوصیم نقض می‌شه / ترسو می‌شم / کنترل می‌شم', 3, 9, 1, 1, NULL, '2019-11-01 18:53:02'),
(199, 13, 'حس برنده بودن دارم / حس خوش‌شانسی دارم / خوش به حالم می‌شه / حس زرنگی می‌کنم / حس موفقیت می‌کنم', 1, 5, 1, 1, NULL, '2019-11-01 18:53:48'),
(200, 14, 'منتفع می‌شم / سود می‌کنم / فایده داره / به موقعیت طلایی می‌رسم / فرصت‌های خوبی گیرم میاد / در موقعیت ارزنده‌ای قرار می‌گیرم', 2, 5, 1, 1, NULL, '2019-11-01 18:54:18'),
(201, 15, 'بدست میارم / داراتر می‌شم / غنی‌تر می‌شم / بیشتر گیرم میاد / ثروتمندتر می‌شم / پیشرفت می‌کنم / توسعه پیدا می‌کنم / برکت پیدا می‌کنم / رفاهم بیشتر می‌شه / در فراوانی قرار می‌گیرم', 3, 5, 1, 1, NULL, '2019-11-01 18:54:55'),
(202, 16, 'حس بازنده بودن دارم / حس بدشانسی دارم / به زررم می‌شه / حس پخمگی می‌کنم / حس شکست می‌کنم', 1, 6, 1, 1, NULL, '2019-11-01 18:55:30'),
(203, 17, 'متضرر می‌شم / ضرر می‌کنم / زیان داره / در بد موقعیت قرار می‌گیرم / فرصت‌های خوبی از دست می‌دم / در موقعیت بدی قرار می‌گیرم', 2, 6, 1, 1, NULL, '2019-11-01 18:55:56'),
(204, 18, 'از دست می‌دم / ندار می‌شم / تهـی‌دست می‌شم / کمتر گیرم میاد / فقیرتـر می‌شم / پسرفت می‌کنم / درجا می‌زنم / بـی‌برکت می‌شه / رفاهم کمتر می‌شه / دچار کمبود منابع می‌شم', 3, 6, 1, 1, NULL, '2019-11-01 18:56:22'),
(205, 19, 'اوضاع پایدارتـره / از ابهام و گنگی خارج می‌شم / اوضاع قابل‌پیش‌بینیه / هماهنگی یا نظم بیشتر به وجود میاد / وضعیت قابل اطمینان یا اتکا است / بیمه می‌شم / آیندم تضمین می‌شه / می‌تونم رو آینده‌ش حساب کنم / اوضاعم مرتب می‌شه / امنیت می‌گیرم / آرامش پیدا می‌کنم  / خیالم راحت می‌شه / اوضاع شسته و رفته می‌شه / در صلح هستم', 1, 3, 1, 1, NULL, '2019-11-01 18:57:03'),
(206, 20, 'در تعهدم هستم / وفای به عهد کردم / به مسئولیت و وظایفم عمل کردم', 2, 3, 1, 1, NULL, '2019-11-01 18:57:29'),
(207, 21, 'تحت حمایت قرار می‌گیرم / به خدا نزدیک می‌شم / دوستام رو زیاد می‌کنم / نزدیکانم رو خوشحال می‌کنم / پشت و پناه پیدا می‌کنم / تأمین می‌شم / ساپورت می‌شم', 3, 3, 1, 1, NULL, '2019-11-01 18:57:58'),
(208, 22, 'اوضاع ناپایدار می‌شه / در ابهام و گنگی قرار می‌گیرم / اوضاع غیرقابل‌پیش‌بینیـه / ناهماهنگی یا بی‌نظمی بیشتر می‌شه / وضعیت غیرقابل اطمینان یا اتکا است / تضمینی ندارم / آینده م نامشخص می‌شه / نمیتونم رو آیندش حساب کنم / اوضاعم آشفته می‌شه / ناامن می‌شم / نگران می‌شم / خیالم راحت نیست / اوضاع درهم و بر هم می‌شه / در بلوا هستم', 1, 4, 1, 1, NULL, '2019-11-01 18:58:55'),
(209, 23, 'خارج از تعهدم عمل می‌کنم / خیانت کردم / به مسئولیت و وظایفم عمل نکردم', 2, 4, 1, 1, NULL, '2019-11-01 18:59:40'),
(210, 24, 'حمایت‌هام رو از دست قرار می‌دم / از خدا دور می‌شم / دوستام  رو از دست می‌دم / نزدیکانم رو ناراحت می‌کنم / بی‌پشت و پناه می‌شم / تامین نمی‌شم / ساپورت نمی‌شم', 3, 4, 1, 1, NULL, '2019-11-01 19:00:15'),
(211, 25, 'مورد توجه قرار می‌گیرم / درباره‌ام فکر خوب می‌کنند / خاص و تَک می‌شم / متفاوت می‌شم / خفن و شگفت‌انگیز می‌شم / دیده می‌شم / درباره‌ام فکر خوب می‌کنند / احساس افتخار می‌کنم / باعث افتخار می‌شم / تحسین می‌شم / تشویق می‌شم / باکلاس می‌شم / بالاتر قرار می‌گیرم / محبوب می‌شم / جایگاه پیدا می‌کنم / عزت نفسم بالا میره', 1, 1, 1, 1, NULL, '2019-11-01 19:01:01'),
(212, 26, 'شبیه قهرمانم می‌شم / کار قهرمانانه‌ای می‌کنم / منطبق با ایده های شخصیم عمل می‌کنم / به سمت / رؤیاهام حرکت می‌کنم / همسو با آرزوهامه / کار آدم‌های ارزشمند رو انجام می‌دم / از نظر خودم کار مهمی کردم / شایسته پاداش هستم', 2, 1, 1, 1, NULL, '2019-11-01 19:01:28'),
(213, 27, 'اخلاقی هستم / زیبا هستم / انسان هستم / با وجدان هستم / متمدن هستم / شرافتمند هستم / خردمند هستم / بـاهوشم / کار خیر می‌کنم / ثواب می‌کنم / مورد تـأیید خدا قرار می‌گیرم / بلوغم ‌را نشون می‌دم / شعورم رو نشون‌ می‌دم / شخصیتم رو حفظ می‌کنم / به دیگران اهمیت دادم / ارزش‌ها رو حفظ کردم / به نفع هستی عمل کردم / به نفع طبیعت عمل کردم', 3, 1, 1, 1, NULL, '2019-11-01 19:02:00'),
(214, 28, 'مورد بی‌توجهی قرار می‌گیرم / درباره‌ام فکر بد می‌کنند / معمولی می‌شم / مثل بقیه می‌شم / بی‌عرضه و پخمه می‌شم / دیده نمی‌شم / درباره‌ام بد فکر می‌کنند / احساس شرم می‌کنم / باعث افتخار کسی نمی‌شم / تمسخره می‌شم / منع می‌شم / چیپ می‌شم / پایین قرار می‌گیرم / منفور می‌شم / تحقیر می‌شم / عزت نفس پایین میاد', 1, 2, 1, 1, NULL, '2019-11-01 19:03:07'),
(215, 29, 'ضدقهرمانم می‌شم / کار بزدلانه‌ای می‌کنم / بر خلاف ایده‌های شخصیم عمل می‌کنم / بر خلاف / رؤیاهام حرکت می‌کنم / بر خلاف آرزوهامه / کار آدم‌های بی‌ارزش رو انجام می‌دم / از نظر خودم کار مهمی نمی‌کنم / سزاوار جریمه هستم', 2, 2, 1, 1, NULL, '2019-11-01 19:03:43'),
(216, 30, 'اخلاقی نیستم / زشت هستم / انسانی نیستم / بی‌وجدان هستم / وحشی هستم / شریف نیستم / احمق هستم / خنگم / کار شر می‌کنم / گناه می‌کنم / موردتأیید خدا قرار نمی‌گیرم / کم‌عقلیم را نشون می‌دم / بی شعوریم رو نشون می‌دم / شخصیتم رو از دست می‌دم / به دیگران بی محلی دادم / ضد ارزش‌ها عمل کردم / به زیان جهان عمل کردم / به طبیعت آسیب رساندم', 3, 2, 1, 1, '', '2019-11-01 19:04:30'),
(223, 31, 'انرژیم رو بالا می‌بره / سرحالم میاره / با نشاطـم می‌کنه / خستگیـمو برطرف می‌کنه / سرکیفم می‌یاره / بدنمـو نوازش می‌کنه / باهاش تن‌آسودگی رو تجربه می‌کنم / باهاش لطافت بـدنی رو تجربه می‌کنم', 1, 8, 2, 1, NULL, '2019-11-06 15:15:42'),
(224, 32, 'لذت بدنی بهـم می‌ده / بدنمـو ارضا می‌کنه / بدنم رو سر شوق میاره / بدنم رو ‌پر از خواهش می‌کنه', 2, 8, 2, 1, NULL, '2019-11-06 15:15:42'),
(225, 33, 'لذت صوتی داره (خوش‌صداست، گوش‌نـوازه . . .) / لذت بصری داره (خوش‌چهره است، خوش‌لباسـه . . .) / لذت لمسی داره (نوازش می‌کنه، لطیف لمس می‌کنه . . .) / لذت بویایی داره (بوی خوبی می‌ده، خوش‌عـطره . . .) / لذت چشایی داره (باهاش طعم‌های خوب رو می‌چشم . . .)', 3, 8, 2, 1, NULL, '2019-11-06 15:15:42'),
(226, 34, 'انرژیم رو پایین می‌یاره / حوصله‌م رو سر می‌بره / بی‌حالم می‌کنه / خسته‌ام می‌کنه / ضدحالـه / بدنمـو آسیب می‌زنه / باهاش آزار رو تجربه می‌کنم / باهاش خشونت بـدنی رو تجربه می‌کنم', 1, 10, 2, 1, NULL, '2019-11-06 15:15:42'),
(227, 35, 'رنج بدنی بهـم می‌ده / بدنمـو ارضا نمی‌کنه / بدنم رو سر شوق نـمیاره / بدنم رو ‌پر از بیزاری می‌کنه', 2, 10, 2, 1, NULL, '2019-11-06 15:15:42'),
(228, 36, 'آزار صوتی داره (بد صداست، خر و پف می کنه...) / آزار بصری داره (بد چهره است، بد لباسه، . . .) / آزار لمسی داره (کتک می‌زنه، بد لمس می‌کنه . . .) / آزار بویایی داره (بوی بد می‌ده ...) / آزار چشایی داره (ناچار می‌شم غذای بدی بخورم، . . .)', 3, 10, 2, 1, NULL, '2019-11-06 15:15:42'),
(229, 37, 'بهم آزادی عمل می‌ده / بهم حق انتخاب می‌ده / درحضورش احساس قدرت می‌کنم/ به خلاقیت تشویقم می‌کنه / شهامت خلاق‌بودن بهم می‌ده / بهم فضای شخصی می‌ده / بهم اختیار می‌ده / اختیاردهنده‌ست / حریم خصوصیم رو رعایت می‌کنه/ دخالت بی‌جا نمی‌کنه / حرف زور نمی‌زنه / مچ‌گیری نمی‌کنه / محدودم نمی‌کنه / مجبورم نمی‌کنه / کنترلم نمی‌کنه', 1, 7, 2, 1, NULL, '2019-11-06 15:36:36'),
(230, 38, 'تنهایی تصمیم نمی‌گیره / روش نفوذ دارم / نظرم روش اثر داره / به حرفم گوش می‌ده / تحت تأثیر منه', 2, 7, 2, 1, NULL, '2019-11-06 15:36:36'),
(231, 39, 'اون انتخاب منه / اون می‌تونه گزینه محبوب من باشه / تجربه من با او از سر قدرت و آزادیه / اگه دست خودم‌ بود من بازم اون رو انتخاب می‌کردم', 3, 7, 2, 1, NULL, '2019-11-06 15:36:36'),
(232, 40, 'آزادی عملم رو می‌گیره / حق انتخاب رو ازم می‌گیره/ در حضورش احساس ضعف می‌کنم / مانع خلاقیتم می‌شه / شهامت خلاق بودن رو ازم می‌گیره / فضای شخصیم رو می‌گیره /  بهم حس اجبار می‌ده / مجبورکننده‌ست/ حریم خصوصیم رو رعایت نمی‌کنه /  دخالت بی‌جا می‌کنه/ حرف زور می‌زنه / مچ گیری می‌کنه / محدودم می‌کنه / مجبورم می‌کنه / کنترلم می‌کنه', 1, 9, 2, 1, NULL, '2019-11-06 15:42:13'),
(233, 41, 'تنهایی تصمیم می‌گیره / روش نفوذ ندارم / نظرم روش اثر نـداره / به حرفم گوش نـمی‌ده / تحت تأثیر من نیست', 2, 9, 2, 1, NULL, '2019-11-06 15:42:13'),
(234, 42, 'اون انتخاب من نیست / اون گزینه محبوب من نبوده / تجربه من با او از سر ضعف و اجباره / اگه دست خودم‌ بود هرگز او رو انتخاب نـمی‌کردم', 3, 9, 2, 1, NULL, '2019-11-06 15:42:13'),
(235, 43, 'بهم احساس برنده بودن می‌ده / چقدر برام امتیاز و دستاورد داره / خوش‌شانسی میاره برام / بودنش کنارم مفیـده / برام اثـرگذاره', 1, 5, 2, 1, NULL, '2019-11-06 16:00:07'),
(236, 44, 'بهم منفعت می‌رسونه / حضورش کنارم سـودداره / برام بـابرکته (قدم خیره) / باعث پیشرفتم می‌شه / بهم فایده میرسونه/ به دردم می‌خوره / خیـررسانه / یاددهنده‌ست / فرصت‌دهنده‌ست', 2, 5, 2, 1, NULL, '2019-11-06 16:00:07'),
(237, 45, 'بهم اعتبار می‌ده / برام فرصت‌سازه / برام ارزش‌آفرینه / برام موقعیت‌های جدید خلق می‌کنه / برام آینده داره / بودن باهاش سرمایه‌گذاریه / بودنش اوضاعم رو بهتر می‌کنه / باهاش بودن باعث تجربه کسب کردنه / باعث کسب مهارته / بهم امید میده / بودنش دنیام رو جای بهتری می‌کنه', 3, 5, 2, 1, NULL, '2019-11-06 16:00:07'),
(238, 46, 'بهم احساس بازنده بودن می‌ده / باهاش امتیازامو از دست می‌دم / بدشانسی میاره برام / بودنش کنار من مضره/برام اثـرگذار نیست', 1, 6, 2, 1, NULL, '2019-11-06 16:05:33'),
(239, 47, 'بهم ضرر می‌رسونه / حضورش کنارم ضرر داره / برام بی‌برکته / باعث پسرفتم می‌شه / بهم ضرر می‌رسونه / به دردم نمی‌خوره / برام بی خیر و برکته / آویـزونه / فرصتام رو می‌سوزونه', 2, 6, 2, 1, NULL, '2019-11-06 16:05:33'),
(240, 48, 'بی‌اعتبارم می‌کنه / فرصت‌هام رو هدر می‌ده / باهاش ارزشم رو از دست می‌دم / برام موقعیت جدیدی خلق نـمی‌کنه / برام آینده نـداره / بودن باهاش سرمایه‌گذاری نیست / بودنش اوضاعم رو بدتر می‌کنه / باهاش بودن تجربه‌هامو خراب می‌کنه / مانع کسب مهارته / ناامیدم می‌کنه / بودنش دنیام رو جای بدتری می‌کنه', 3, 6, 2, 1, NULL, '2019-11-06 16:05:33'),
(241, 49, 'قابل‌اعتماده / امنه / وفاداره / روش می‌تونم حساب کنم / بی‌خطره / خیالم ازش راحته / صادقه / قصدش کمک به منه / روراسته / پایداره / درستکاره / امینه / متعهده / تحت کنترلـه / مـاندگاره / تضمین‌شده‌ست', 1, 3, 2, 1, NULL, '2019-11-06 16:09:31'),
(242, 50, 'قابل اتکاست / بهم جرأت می‌ده / بهم اطمینان خاطر و حس اعتماد می‌ده', 2, 3, 2, 1, NULL, '2019-11-06 16:09:31'),
(243, 51, 'روش می‌تونم حساب کنم / همراهه / حمایتم  می‌کنه / بهم وفاداره / کنارمه / بهـم آسیب نمی‌رسونه / رفیقمـه / بهش عـِرق دارم', 3, 3, 2, 1, NULL, '2019-11-06 16:09:31'),
(244, 52, 'قابل‌اعتماد نیست / ناامنه / خائنه / روش نمیشه حساب کرد / خطرناکه / مطمئن نیست / دروغگو است / قصدش آزار دادن منه / قصدش فریب منه / ناپایداره / خلافکاره /  امین نیست / متعهد نیست / غیرقابل کنترله / رفتنیه / تضمینی نـداره', 1, 4, 2, 1, NULL, '2019-11-06 16:13:42'),
(245, 53, 'قابل اتکا نیست /من رو نگران می‌کنه / اطمینان‌خاطر و اعتماد رو ازم می‌گیره', 2, 4, 2, 1, NULL, '2019-11-06 16:13:42'),
(246, 54, 'روش نمی‌تونم حساب کنم / ولم می‌کنه / حمایتم نمی‌کنه / خیانت می‌کنه / می‌زاره می‌ره / بهـم آسیب می‌رسونه / غریبه‌ست / به من ربطی نداره', 3, 4, 2, 1, NULL, '2019-11-06 16:13:42'),
(247, 61, 'آدم درستیه / قابل تأییده / خانواده داره / ارزشمنده / عالیه / خوشگله / حرف نداره / برام مهمه / باسواده / فهمیده‌ست / دوست‌داشتنیه / شایسته است / اصالت داره / قابل قبوله/ قابل احترامه / این رابطه از سر آگاهی و خرد است', 1, 1, 2, 1, NULL, '2019-11-06 16:19:42'),
(248, 62, 'باعث سربلندیه / باعث‌افتخاره / باعث غروره / آبرومـنده / صادقـه / چه خوب می‌گه / می‌فهمه / چه خوب عمل کرد / کارش قشنگ بود  / کارش درسته / عالیـه / تحسین‌برانگیزه / بر حقـه / دمـش گرم / قابل تقدیره / لایک داره / خردمندانه است / غرورانگیزه', 2, 1, 2, 1, NULL, '2019-11-06 16:19:42'),
(249, 63, 'مهمـه / دیده می‌شه / ارزشمنده / زیباست/ برازنده‌ی هم هستیم / مورد توجهـه / موفقـه / لایق پیشرفتـه / باعـرضـه‌ست/  از من بهتره', 3, 1, 2, 1, NULL, '2019-11-06 16:19:42'),
(250, 64, 'آدم نادرستیه / غیرقابل تأییده / بی‌اصل و نسـبه / بی‌ارزشه / چیپه / زشته / مثلـش زیاده / برام مهم نیست / بی‌سواده / نمی‌فهمه / دوست‌داشتنی نیست / ناشایستـه / بی‌اصالته / غیرقابل قبوله / باعث خجالته / ین رابطه از سر حماقت و ندانم کاری است', 1, 2, 2, 1, NULL, '2019-11-06 16:25:17'),
(251, 65, 'باعث سرافکندگیـه / باعث حقارته / بی‌آبرویـیـه / خالی‌بنده / بد حرف می‌زنه / نفهمـه / خراب‌کاره / کارش زشت بود / کارش درست نیست / ضایع است / تأسف‌برانگیزه / نـاحـقه / خراب کرد / شرم‌آوره / احمقانه است / تحقیرآمیزه', 2, 2, 2, 1, NULL, '2019-11-06 16:25:17'),
(252, 66, 'بـی‌اهمیته / دیده نمی‌شه / بی‌ارزشه / زشتـه / به هم نمیاییم / قابل توجه نیست / ناموفقـه / بی‌لیاقـته / بی‌عرضـه‌ست / از من بـدتره', 3, 2, 2, 1, NULL, '2019-11-06 16:25:17');
